import React from "react";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";

const styles = theme => ({
  root: {
    "padding-top": "5%",
    width: "100%"
  },
  heading: {
    fontSize: theme.typography.pxToRem(15),
    fontWeight: theme.typography.fontWeightRegular
  }
});

function BottomMenu(props) {
  const { classes } = props;
  return (
    <div className={`${classes.root} ${"footer"}`}>
      <ul>
        <li>Home</li>
        <li>
          About Us
          <ul>
            <li>Lorem Ipsum</li>
            <li>Lorem Ipsum</li>
            <li>Lorem Ipsum</li>
            <li>Lorem Ipsum</li>
          </ul>
        </li>
        <li>
          Portfolio
          <ul>
            <li>Lorem Ipsum</li>
            <li>Lorem Ipsum</li>
            <li>Lorem Ipsum</li>
            <li>Lorem Ipsum</li>
          </ul>
        </li>
        <li>Clients</li>
        <li>
          Events
          <ul>
            <li>Lorem Ipsum</li>
            <li>Lorem Ipsum</li>
            <li>Lorem Ipsum</li>
          </ul>
        </li>
        <li>
          Media
          <ul>
            <li>Lorem Ipsum</li>
            <li>Lorem Ipsum</li>
            <li>Lorem Ipsum</li>
            <li>ILorem Ipsum</li>
          </ul>
        </li>
        <li>Contact Us</li>
      </ul>
    </div>
  );
}

BottomMenu.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(BottomMenu);
